

<?xml version="1.0"?>
<?mso-application progid="Excel.Sheet"?>
<Workbook xmlns="urn:schemas-microsoft-com:office:spreadsheet"
 xmlns:o="urn:schemas-microsoft-com:office:office"
 xmlns:x="urn:schemas-microsoft-com:office:excel"
 xmlns:ss="urn:schemas-microsoft-com:office:spreadsheet"
 xmlns:html="http://www.w3.org/TR/REC-html40">
 <ExcelWorkbook xmlns="urn:schemas-microsoft-com:office:excel" />
 <Styles>
  <Style ss:ID="Default" ss:Name="Normal">
   <Alignment ss:Vertical="Bottom"/>
   <Borders/>
   <Font/>
   <Interior/>
   <NumberFormat/>
   <Protection/>
  </Style>
  <!--@BLOCK:customstyles|repeatfor:customstyles-->
  <Style ss:ID="<!--@id-->">
    <Alignment ss:Vertical="<!--@vertalign|default:Center-->" ss:Horizontal="<!--@horizalign|default:Automatic-->" <!--@BLOCK:textrotate|printifset:textrotate-->ss:Rotate="<!--@textrotate-->"<!--@ENDBLOCK:textrotate-->/>
	<!--@BLOCK:bordersset|printiftrue:borders-->
    <Borders>
      <!--@BLOCK:borderbottom|printiftrue:borderbottom--><Border ss:Position="Bottom" ss:LineStyle="Continuous" ss:Weight="1"/><!--@ENDBLOCK:borderbottom-->
	  <!--@BLOCK:borderleft|printiftrue:borderleft--><Border ss:Position="Left" ss:LineStyle="Continuous" ss:Weight="1"/><!--@ENDBLOCK:borderleft-->
	  <!--@BLOCK:borderright|printiftrue:borderright--><Border ss:Position="Right" ss:LineStyle="Continuous" ss:Weight="1"/><!--@ENDBLOCK:borderright-->
	  <!--@BLOCK:bordertop|printiftrue:bordertop--><Border ss:Position="Top" ss:LineStyle="Continuous" ss:Weight="1"/><!--@ENDBLOCK:bordertop-->
    </Borders>
    <!--@ENDBLOCK:bordersset-->
    <!--@BLOCK:bordersnotset|printiffalse:borders--><Borders/><!--@ENDBLOCK:bordersnotset-->
    <!--@BLOCK:bgcol|printifset:bgcol--><Interior ss:Color="#FFFFFF" ss:Pattern="Gray25" ss:PatternColor="<!--@bgcol-->"/><!--@ENDBLOCK:bgcol-->
	<!--@BLOCK:financial|printifequalto:format:"financial"--><NumberFormat ss:Format="&quot;£&quot;#,##0;[Red]\-&quot;£&quot;#,##0"/><!--@ENDBLOCK:financial-->
	<!--@BLOCK:percentage|printifequalto:format:"percentage"--><NumberFormat ss:Format="Percent"/><!--@ENDBLOCK:percentage-->
	<!--@BLOCK:standard|printifequalto:format:"separatethousands"--><NumberFormat ss:Format="Standard"/><!--@ENDBLOCK:standard-->
    <Font <!--@BLOCK:bold|printiftrue:bold-->ss:Bold="1"<!--@ENDBLOCK:bold--><!--@BLOCK:fontsize|printifset:fontsize--> ss:Size="<!--@fontsize-->"<!--@ENDBLOCK:fontsize-->/>
  </Style>
  <!--@ENDBLOCK:customstyles-->
 </Styles>
 <Worksheet ss:Name="<!--@worksheetname|default:"Untitled worksheet"-->">
  <!--@names-->
  <Table>
  <!--@BLOCK:columns|repeatfor:columns-->
   <Column ss:Width="<!--@width-->" />
  <!--@ENDBLOCK:columns-->
  <!--@BLOCK:rows|repeatfor:rows-->
   <Row<!--@BLOCK:height|printifset:height--> ss:Height="<!--@height-->"<!--@ENDBLOCK:height-->>
    <!--@cells-->
   </Row>
  <!--@ENDBLOCK:rows-->
  </Table>
  <WorksheetOptions xmlns="urn:schemas-microsoft-com:office:excel">
   <PageSetup>
    <Layout x:Orientation="Landscape"/>
	<!--@spreadsheetheader-->
	<!--@BLOCK:defaultheader|printifnotset:spreadsheetheader-->
		<!--@BLOCK:spreadsheetname|printifset:spreadsheetname--><Header x:Data="&amp;R<!--@spreadsheetname-->"/><!--@ENDBLOCK:spreadsheetname-->
	<!--@ENDBLOCK:defaultheader-->
	<!--@spreadsheetfooter-->
	<!--@BLOCK:defaultfooter|printifnotset:spreadsheetfooter-->
		<Footer x:Margin="0.3" x:Data="&amp;L&amp;&quot;Verdana,Regular&quot;&amp;8&amp;F: &amp;A&amp;C&amp;&quot;Verdana,Regular&quot;&amp;8&amp;P of &amp;N&amp;R&amp;&quot;Verdana,Regular&quot;&amp;8Printed: &amp;D &amp;T"/>
	<!--@ENDBLOCK:defaultfooter-->
    <PageMargins x:Bottom="<!--@bottommargin|default:0.4-->" x:Left="<!--@leftmargin|default:0.77-->" 
     x:Right="<!--@rightmargin|default:0.77-->" x:Top="<!--@topmargin|default:1-->"/>
   </PageSetup>
   <Print>
    <ValidPrinterInfo/>
    <PaperSizeIndex>9</PaperSizeIndex>
    <Scale>55</Scale>
    <HorizontalResolution>600</HorizontalResolution>
    <VerticalResolution>600</VerticalResolution>
	<!--@BLOCK:fitpageheight|printiftrue:fittopage--><FitHeight>32767</FitHeight><!--@ENDBLOCK:fitpageheight-->
	<!--@BLOCK:printgridlines|printiftrue:displaygridlines--><Gridlines/><!--@ENDBLOCK:printgridlines-->
	<!--@printopts-->
   </Print>
   <Selected/>
   <!--@BLOCK:screengridlines|printiffalse:displaygridlines--><DoNotDisplayGridlines/><!--@ENDBLOCK:screengridlines-->
   <!--@BLOCK:fitpagewidth|printiftrue:fittopage--><FitToPage/><!--@ENDBLOCK:fitpagewidth-->
   <!--@worksheetopts-->

   <!--@BLOCK:freezepanes|printiftrue:freezepanes-->
	   <FreezePanes/>
	   <FrozenNoSplit/>

		<!--@BLOCK:splithorizontal|printiftrue:splithorizontal-->
	   <SplitHorizontal><!--@splithorizontal--></SplitHorizontal>
	   <TopRowBottomPane><!--@splithorizontal--></TopRowBottomPane>
			<!--@BLOCK:activepanesplitboth|printiftrue:splitvertical-->
					<ActivePane>0</ActivePane>
			<!--@ENDBLOCK:activepanesplitboth-->
			<!--@BLOCK:activepanesplithorizonly|printiffalse:splitvertical-->
					<ActivePane>2</ActivePane>
			<!--@ENDBLOCK:activepanesplithorizonly-->
		<!--@ENDBLOCK:splithorizontal-->

	   <!--@BLOCK:splitvertical|printiftrue:splitvertical-->
	   <SplitVertical><!--@splitvertical--></SplitVertical>
	   <LeftColumnRightPane><!--@splitvertical--></LeftColumnRightPane>
			<!--@BLOCK:activepanesplitvertonly|printiffalse:splithorizontal-->
					<ActivePane>1</ActivePane>
			<!--@ENDBLOCK:activepanesplitvertonly-->
	   <!--@ENDBLOCK:splitvertical-->

	   <Panes>
		<Pane>
		 <Number>3</Number>
		</Pane>
		<!--@BLOCK:paneone|printiftrue:splitvertical-->
		<Pane>
		 <Number>1</Number>
		</Pane>
		<!--@ENDBLOCK:paneone-->

		<!--@BLOCK:panetwo|printiftrue:splithorizontal-->
		<Pane>
		 <Number>2</Number>
		</Pane>
		<!--@ENDBLOCK:panetwo-->

		<!--@BLOCK:panezeroouter|printiftrue:splithorizontal-->
			<!--@BLOCK:panezeroinner|printiftrue:splitvertical-->
				<Pane>
				 <Number>0</Number>
				</Pane>
			<!--@ENDBLOCK:panezeroinner-->
		<!--@ENDBLOCK:panezeroouter-->

	   </Panes>
	<!--@ENDBLOCK:freezepanes-->

	<!--@BLOCK:nofreezepanes|printiffalse:freezepanes-->
	   <Panes>
		<Pane>
		 <Number>3</Number>
		 <ActiveRow>17</ActiveRow>
		 <ActiveCol>1</ActiveCol>
		</Pane>
	   </Panes>
   <!--@ENDBLOCK:nofreezepanes-->

   <ProtectObjects>False</ProtectObjects>
   <ProtectScenarios>False</ProtectScenarios>
  </WorksheetOptions>
 </Worksheet>
</Workbook>
